import React from 'react';
import TableBody from '../TableBody'

const Table = props => {
    return (
        <>
          
            <table className="table">
                <thead className="thead-dark">
                    <tr>
                        <th scope="col">#</th>
                        
                        <th scope="col" onClick={()=>props.sort("title")}>Recipe Title</th>
                        <th scope="col" onClick={()=>props.sort("ingredients")}>Ingredients</th>
                        
                    </tr>
                </thead>
                <tbody>
                    {props.recipe.map((recipe, i) => (
                        <TableBody
                            key={recipe.title.uuid}
                            num={i + 1}
                        />


                    ))}

                </tbody>
            </table>
        </>
    )

}

export default Table;
